  false,\n\t\"url\": null,\n\t\"notes\": \"These output tables contain parsed and
  format validated data from the various VMS forms that are sent from any given vessel,
  while at sea, from the VMS devices on their vessels.  Forms included are:nnCatch
  reports for Herring, Multispecies, Scallop, Mackerel/Squid.nnPreland reports for
  Herring, Scallop, Mackerel.nnMonk overage reports - vessels can indicate if they've
  caught more monkfish than a trip allows, permitted under current regulations.  nnTrip
  start and trip end hails for Sector trips, RSA/EFP trips.nnGulf of Maine Cod trip
  limit exemption.n\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
